import Banner from "../components/Banner";
import Featured from "../components/Featured";
import NavBar from "../components/NavBar";

function LandingPage() {
	return (
		<div>
			<NavBar />
			<div className="mt-12 z-[-1]">
				<Banner />
				<Featured />
			</div>
		</div>
	)
}


export default LandingPage;
